import React from 'react';
import Grid from '@material-ui/core/Grid';
import { ProductTypeFilter } from '/componentsdomain/input/buttons/filterButtonGroups/common/productTypeFilter';

export const CommonFilterCollection = props => {

    return (
        <Grid container spacing={1}>
            <ProductTypeFilter handleProductType={props.handleProductType} />
            {props.filterGroup}
        </Grid>

    );
};
